import refferencebanner from '../../assets/referral_banner2.jpg';

const Refference = () => {
    return (
        <div >
            <div className='mx-auto max-w-7xl'>
<img src={refferencebanner} alt="" />
            </div>
        </div>
    );
};

export default Refference;
